import React, {Component} from 'react';
import Typist from 'react-typist';
 
export default class TypistHeader extends Component {
 
  render() {
    return (
      <Typist>
            <span id='typist'>Data Scientist / Data Analyst / Web Developer</span>
      </Typist>
    );
  }
}
